const imgData = Buffer.from(IMG_RAW().match(/(?<=base64,).+/msi).toString(), "base64");
const fn = __dirname + "/img.jpg";
fs.writeFileSync(fn, imgData);

async function test() {
    const formData = new FormData();
    formData.append("image", imgData);
    formData.append("type", "file");
    formData.append("name", "i.jpg");
    const req = await axios.post("https://api.imgur.com/3/upload", formData, {
        headers: {
            Authorization: "Client-ID " + process.env.IMGUR_API_KEY
        },
        validateStatus: () => true
    });
    console.log(req.data);
}

test();